      align-items: center;

      justify-content: space-between;

    }

    }

      display: flex;
      flex-direction: column;
      flex-grow: 1
    }

      background: #292929 linear-gradient(180deg, #292929, #1b1b1b);

    }

      font-size: 18px;
      font-style: italic;
      font-weight: 700;
      line-height: 1
    }

    .pl {
      background-color: #343434;
      border: 1px solid #292929;
      border-radius: 10px;
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      padding: 10px
    }

    .pl__cnt {
      background-color: #000;
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: "";
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px

      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

      justify-content: space-between;
      padding: 10px

    .info {

    }
